{
	return rna_pointer_inherit_refine(&iter->parent, &RNA_Node, rna_iterator_listbase_get(iter));
}

void CompositorNodeTree_nodes_begin(CollectionPropertyIterator *iter, PointerRNA *ptr)
{
	bNodeTree *data= (bNodeTree*)(ptr->data);

	memset(iter, 0, sizeof(*iter));
	iter->parent= *ptr;
	iter->prop= (PropertyRNA*)&rna_CompositorNodeTree_nodes;

	rna_iterator_listbase_begin(iter, &data->nodes, NULL);

	if(iter->valid)
		iter->ptr= CompositorNodeTree_nodes_get(iter);
}

void CompositorNodeTree_nodes_next(CollectionPropertyIterator *iter)
{
	rna_iterator_listbase_next(iter);

	if(iter->valid)
		iter->ptr= CompositorNodeTree_nodes_get(iter);
}

void CompositorNodeTree_nodes_end(CollectionPropertyIterator *iter)
{
	rna_iterator_listbase_end(iter);
}

int CompositorNodeTree_nodes_lookup_int(PointerRNA *ptr, int index, PointerRNA *r_ptr)
{
	int found= 0;
	CollectionPropertyIterator iter;

	CompositorNodeTree_nodes_begin(&iter, ptr);

	if(iter.valid){
		ListBaseIterator *internal= iter.internal;
		if(internal->skip) {
			while(index-- > 0 && iter.valid) {
				rna_iterator_listbase_next(&iter);
			}
			found= (index == -1 && iter.valid);
		}
		else {
			while(index-- > 0 && internal->link)
				internal->link= internal->link->next;
			found= (index == -1 && internal->link);
		}
		if(found) *r_ptr = CompositorNodeTree_nodes_get(&iter);
	}

	CompositorNodeTree_nodes_end(&iter);

	return found;
}

